import React, { useState, useEffect } from "react";

export default function Videos({ videos }) {
  return (
    <div>
      <ul className="video-list">
        {videos &&
          videos.map((v) => {
            <li>
              <video src={v.uri} width="100"></video>
            </li>;
            console.log(v.uri);
            // <li>{style}</li>;
          })}
      </ul>
    </div>
  );
}
